// StateList.js

import React, { useState, useEffect } from 'react';

const StateList = () => {
  const [stateList, setStateList] = useState([]);

  useEffect(() => {
    // Fetch the list of states from your API endpoint
    fetch('/api/states') // Update the endpoint to match your server
      .then(response => response.json())
      .then(data => setStateList(data))
      .catch(error => console.error('Error fetching state list:', error));
  }, []);

  return (
    <div>
      <h2>State List</h2>
      <ul>
        {stateList.map(state => (
          <li key={state._id}>{state.name}</li>
        ))}
      </ul>
    </div>
  );
};

export default StateList;
